/*
* 文件名: AnimalFeeding_prc3.sol
* 编译器版本: 0.4.19
*/

pragma solidity ^0.4.19;

// 导入 prc3 版本的 AnimalIncubators
import "./AnimalIncubators_prc3.sol";

contract AnimalFeeding is AnimalIncubators {

    // (这个函数没有变化)
    function _catchFood(uint _name) internal pure returns (uint) {
        uint rand = uint(keccak256(_name));
        return rand;
    }

    // 步骤 4.3: 修改 feedAndGrow 函数
    // 步骤 4.3.a: 修改可见性为 internal
    function feedAndGrow(uint _AnimalId, uint _targetDna) internal {

        require(msg.sender == animalToOwner[_AnimalId]);
        Animal storage myAnimal = animals[_AnimalId];

        // 步骤 4.3.b: 检查该宠物是否已经冷却完毕 (当前时间 > 宠物的冷却截止时间)
        require(now >= myAnimal.readyTime);

        uint foodDna = _targetDna % dnaLength;
        uint newDna = (myAnimal.dna + foodDna) / 2;
        newDna = (newDna / 100) * 100 + 99;

        // 步骤 4.3.c: 重新设置该宠物的冷却周期 (表示捕食行为完成)
        myAnimal.readyTime = uint32(now + cooldownTime);

        _createAnimal("No-one", newDna);
    }

    // (这个函数没有变化, 它现在调用 internal 的 feedAndGrow)
    function feedOnFood(uint _AnimalId, uint _FoodId) public {
        
        uint foodDna = _catchFood(_FoodId);
        feedAndGrow(_AnimalId, foodDna);
    }

}

contracts/AnimalIncubators_prc3.sol.content:
/*
* 文件名: AnimalIncubators_prc3.sol
* 编译器版本: 0.4.19
*/

pragma solidity ^0.4.19;

// 步骤 1: 导入 ownable.sol
import "./ownable.sol";

// 步骤 1: 让 AnimalIncubators 继承 Ownable
contract AnimalIncubators is Ownable {

    event NewAnimal(uint AnimalId, string name, uint dna);

    uint dnaDigits = 16;
    uint dnaLength = 10 ** dnaDigits;

    // 步骤 3.1: 声明 "冷却周期" 为 60 秒
    uint cooldownTime = 60 seconds;

    // 步骤 2: 给宠物 struct 增加 level 和 readyTime 属性
    struct Animal {
        string name;
        uint dna;
        uint32 level;
        uint32 readyTime; // 喂食的冷却截止时间
    }

    Animal[] public animals;

    mapping (uint => address) public animalToOwner;
    mapping (address => uint) public ownerAnimalCount;


    // 步骤 3.2: 修改 _createAnimal 函数
    function _createAnimal(string _name, uint _dna) internal {
        
        // 步骤 3.2: 新建宠物时，增加冷却周期
        // 注意：新宠物的 level 默认初始化为 0
        //       readyTime 被设置为 (当前时间 + 冷却时间)
        uint32 ready = uint32(now + cooldownTime);
        
        uint id = animals.push(Animal(_name, _dna, 0, ready)) - 1;

        animalToOwner[id] = msg.sender;
        ownerAnimalCount[msg.sender]++;

        NewAnimal(id, _name, _dna);
    }

    function _generateRandomDna(string _str) private view returns (uint) {
        uint rand = uint(keccak256(_str));
        return rand % dnaLength;
    }

    function createRandomAnimal(string _name) public {
        
        // 步骤 2.1 (来自 image_630b83.png): 暂时注释掉 require 语句
        // require(ownerAnimalCount[msg.sender] == 0);

        uint randDna = _generateRandomDna(_name);
        _createAnimal(_name, randDna);
    }

}

contracts/ownable.sol.content:
/*
* 文件名: ownable.sol
* 编译器版本: 0.4.19
*/

pragma solidity ^0.4.19;

contract Ownable {
    
    address public owner;

    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);

    // 构造函数
    function Ownable() public {
        owner = msg.sender;
    }

    // 修饰符
    modifier onlyOwner() {
        require(msg.sender == owner);
        _;
    }

    // 转移所有权函数
    function transferOwnership(address newOwner) public onlyOwner {
        require(newOwner != address(0));
        
        // 修正: 移除了 'emit' 关键字
        OwnershipTransferred(owner, newOwner); 
        
        owner = newOwner;
    }
}
